import React from 'react';

const PropertyCard = ({ property }) => {
  const { image, title, location, price, area } = property;

  return (
    <div className="relative overflow-hidden rounded-[20px] aspect-[4/3] group cursor-pointer">
      {/* Image */}
      <img
        src={image}
        alt={title}
        className="w-full h-full object-cover"
      />

      {/* Price Tag - Top Right */}
      <div className="absolute top-4 right-4 bg-white/10 backdrop-blur-md rounded-full px-4 py-2 text-white font-semibold">
        {price}
      </div>

      {/* Gradient Overlay */}
      <div className="absolute inset-0 bg-gradient-to-t from-[#00513B]/90 to-transparent" />

      {/* Content */}
      <div className="absolute bottom-0 left-0 right-0 p-4">
        <h3 className="text-white text-xl font-semibold mb-1 line-clamp-2">
          {title}
        </h3>
        <div className="flex justify-between items-center">
          <p className="text-white/90">
            {location}
          </p>
          <p className="text-white/90">
            {area}
          </p>
        </div>
      </div>
    </div>
  );
};

export default PropertyCard;
